import React from "react";

const AdminDashboard = () => {
  return (
    <div className="mt-[75px]">
      <h1 className="text-3xl font-semibold py-4">
        Dashboard
      </h1>
      <div className="flex flex-row">
        <div className="flex flex-col rounded-[4px] gap-4 border-2 border-gray-400  overflow-hidden">
          <h4>Earnings</h4>
        </div>
        <div className="flex flex-col rounded-[4px] gap-4 border-2 border-gray-400 overflow-hidden"></div>
        <div className="flex flex-col rounded-[4px] gap-4 border-2 border-gray-400 overflow-hidden"></div>
      </div>
    </div>
  );
};

export default AdminDashboard;
